import React from 'react';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faChartPie } from '@fortawesome/fontawesome-free-solid';
function Icon2() {
	return (
		<div>
			<FontAwesomeIcon className="ic" icon={faChartPie} />
		</div>
	);
}
export default Icon2;
